    def del_rule(self,ind):
        self.valy.removeItem(self.verSpacer)
        #print(self.index)
        #print(self.content)
        for i in range(self.index):
                
            #print(i)
            #print(self.scrollAreaWidgetContents.children())
            self.to_del = self.scrollAreaWidgetContents.children()[i+1]
            self.valy.removeWidget(self.to_del)
            self.to_del.deleteLater()
        self.content.pop(ind)
        tem = self.index
        self.index = 0
        for i in range(tem-1):
            if self.content[i][0] == 'like_time':
                self.add_like_time_rule(i,self.content[i][1],falg=False)
            elif self.content[i][0] == 'dislike_time':
                self.add_dislike_time_rule(i,self.content[i][1],falg=False)
            elif self.content[i][0] == 'like_teacher':
                self.add_like_teacher_rule(i,self.content[i][1],falg=False)
            elif self.content[i][0] == 'like_course':
                self.add_like_course_rule(i,self.content[i][1],falg=False)
          
        self.valy.addItem(self.verSpacer)
